'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt is not simply the brightest who have the best ideas; it is those who are best at harvesting ideas\n\nDecember 1, 2015\n\u001c9\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfrom others. It is not only the most determined who drive change; it is those who most fully engage with like-minded people. And it is not wealth or prestige that best motivates people; it is respect and help from peers.\n\nDecember 1, 2015\n\u001c9\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c. I don’t teach traditional classes; instead, I bring in visitors with new ideas and get people to interact with others who are on the same journey. When I was academic head of the Media Lab I pushed to get rid of traditional grading; instead, we have tried to grow a community of peers where respect and collaboration on real-world projects is the currency of success and further opportunity. We live in social networks, not in the classroom or laboratory.\n\nDecember 2, 2015\n\u001c9\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt was only when they began to meet and spend informal time together that new ideas began to bubble up and new ways of approaching problems began to spread.\n\nDecember 2, 2015\n\u001c10\n\u0011\n\u0011\n\n\n1 • From Ideas to Actions\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn his book Theory of Moral Sentiments he argued that it was human nature to exchange not only goods but also ideas, assistance, and favors out of sympathy. 1 Furthermore, he thought that these social exchanges guided capitalism to create solutions for the good of the community. Smith, though, lived in an era where almost all the bourgeois residents in a city knew each other and were constrained by social pressure to be good\n\nDecember 2, 2015\n\u001c15\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSocial physics is a quantitative social science that describes reliable, mathematical connections between information and idea flow on the one hand and people’s behavior on the other. Social physics helps us understand how ideas flow from person to person through the mechanism of social learning and how this flow of ideas ends up shaping the norms, productivity, and creative output of our companies, cities, and societies. It enables us to predict the productivity of small groups, of departments within companies, and even of entire cities. It also helps us tune communication networks so that we can reliably make better decisions and become more productive.\n\nDecember 4, 2015\n\u001c16\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cspread and combination of new ideas is what drives behavior change and innovation\n\nDecember 4, 2015\n\u001c17\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cproblem was to change the social network, in order to slow down the spread of new strategies within it. When we implemented these changes, it doubled the average return on investment, leaving the standard economic approaches in the dust. Slowing down the spread of ideas is not something that is found in a standard management handbook. And this result was no accident, because we had mathematical analyses based on millions of bits of data that made it possible for us to devise precise interventions and predict precisely what the outcome would be. Those equations are part of the mathematics of social physics, as I will begin to explain in Chapter 2 .\n\nDecember 4, 2015\n\u001c17\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe ultimate test of a practical theory, of course, is whether or not it can be used to shape outcomes. Is it good enough for engineering? To answer this question I will show how this new theory is already being used to create better companies, cities, and social institutions.\n\nDecember 4, 2015\n\u001c19\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSocial physics functions by analyzing patterns of human experience and idea exchange within the digital bread crumbs we all leave behind us as we move through the world—call records, credit card transactions, and GPS location fixes, among others. These data tell the story of everyday life by recording what each of us has chosen to do. And this is very different from what is put on Facebook; postings on Facebook are what people choose to tell each other, edited according to the standards of the day. Who we actually are is more accurately determined by where we\n\nDecember 4, 2015\n\u001c20\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1rdO7dLaSEh9HI6k8-aiJK7maJEwzixWA0liI0GY","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1Ri56-u_yTRSa89rpaDnx_pzbtkSyUOl0VEtJoc0","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr"