xt","si":3744,"ei":3761,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3762,"ei":3779,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3780,"ei":4346,"sm":{"ts_ff_i":false,"ts_va":"nor","ts_it":true,"ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4347,"ei":4364,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4365,"ei":4370,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="P3z/fK0irND5Ak6++hBkmV5UaGI"  nonce="P3z/fK0irND5Ak6++hBkmV5UaGI">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="P3z/fK0irND5Ak6++hBkmV5UaGI"  nonce="P3z/fK0irND5Ak6++hBkmV5UaGI">DOCS_modelChunk = [{"ty":"is","ibi":4371,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cspend our time and which things we buy, not just by what we say we do. 9\n\nWho am i? Depends on what I buy and where I spend my time.. Where should I be spending my time? Who we spend our time with too huh? Also what does this say about Grow?\n\nDecember 8, 2015\n\u001c20\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001creality mining, and through it we can tell an enormous amount about who individuals are. My students and I have found that we can use it to tell if people are likely to get diabetes or whether someone is the sort of person who will pay back loans.\n\nDecember 8, 2015\n\u001c20\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSocial learning , which is how new ideas become habits, and how learning can be accelerated and shaped by social pressure\n\nDecember 8, 2015\n\u001c26\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csocial physics is about how human behavior is driven by the exchange of ideas—how people cooperate to discover, select, and learn strategies and coordinate their actions—rather than how markets are driven by the exchange of money.\n\nDecember 8, 2015\n\u001c27\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA fundamental assumption is that learning from examples of other people’s behavior (and the relevant contextual features) is a major and likely dominant mechanism o\n\nDecember 8, 2015\n\u001c27\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbehavior change in humans. Because it does not try to capture internal cognitive processes, social physics is inherently probabilistic, with an irreducible kernel of uncertainty caused by avoiding the generative nature of conscious human thought.\n\nDecember 8, 2015\n\u001c27\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis vision of a data-driven society implicitly assumes that the data will not be abused. However, the ability to see the details of the market, of political revolutions, and to be able to predict and control them is a case of Promethean fire—it could be used for good or for ill\n\nDecember 8, 2015\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMaintaining protection of personal privacy and freedom is critical to the success of any society.\n\nDecember 8, 2015\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe need to revive the social sciences by constructing living labs to test and prove ideas for building data-driven societies\n\nDecember 8, 2015\n\u001c29\n\u0011\n\u0011\n\n\nPART ONE | Social Physics\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most consistently creative and insightful people are explorers. They spend an enormous amount of time seeking out new people and different ideas, without necessarily trying very hard to find the “best” people or “best” ideas. Instead, they seek out people with different views and different ideas.\n\nDecember 8, 2015\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most productive people are constantly developing and testing a new story, adding newly discovered ideas to the story and then trying it out on everyone they meet. Like sculpting raw clay into a beautiful statue, over time their story becomes more and more compelling. Finally they decide that it is time to act on it, to bring it into the light and test it against reality. To these people, the practice of harvesting, winnowing, and sculpting with ideas feels like play. In fact, some of them call it “serious play.” 2\n\nDecember 8, 2015\n\u001c34\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe main work of science, art, or leadership is the same: developing a compelling story about the world and then deciding to test it against reality. In science, stories are tested against real-world behavior; in the arts, against their ability to\n\nDecember 8, 2015\n\u001c34\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cinfluence the ongoing cultural dialogue; and in management, against their success in business or government.\n\nDecember 8, 2015\n\u001c34\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPooling works for simple estimation problems because without social interactions the pieces of information are sufficiently independent that we can use simple mathematics to combine them, i.e., just take the average answer or the median answer\n\nIf your friends on Grow are all socially interacting, then the evaluations are not independent and you cannot just take the average. Which is fine. We want diverse feedback but that\u0027s not always possible.\n\nDecember 8, 2015\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe process of social learning implies that if there is a lot of interaction between\n\nDecember 8, 2015\n\u001c40\n\u0011\n\u0011"},{"ty":"te","id":"i.11","spi":4380},{"ty":"te","id":"i.12","spi":4659},{"ty":"te","id":"i.13","spi":4944},{"ty":"te","id":"i.14","spi":5103},{"ty":"te","id":"i.15","spi":5371},{"ty":"te","id":"i.16","spi":5573},{"ty":"te","id":"i.17","spi":5857},{"ty":"te","id":"i.18","spi":6174},{"ty":"te","id":"i.19","spi":6309},{"ty":"te","id":"i.20","spi":6499},{"ty":"te","id":"i.21","spi":6838},{"ty":"te","id":"i.22","spi":7399},{"ty":"te","id":"i.23","spi":7684},{"ty":"te","id":"i.24","spi":7830},{"ty":"te","id":"i.25","spi":8317},{"ty":"as","st":"paragraph","si":4371,"ei":4371,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4372,"ei":4372,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4373,"ei":4373,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4375,"ei":4375,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4377,"ei":4377,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":4379,"ei":4379,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,