12\u001c*\n\u001csomeone showing the behavior (the role model) and a new person, and if the new person is susceptible, then it is likely that this new idea will take root and change the new person’s behavior. Susceptibility depends on several factors, including whether the role model is sufficiently similar to the new person that the new behavior is likely to be useful; that the level of trust between the role model and the new person is high; and the consistency between the new idea and previously learned behaviors. As a result, the flow of ideas can sometimes be quite slow, rather different from the viral marketing that advertising agencies like to talk about. 21\n\nWhat matters? Meeting David or what u have done since then thru bring inspired by him.\n\nDecember 8, 2015\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cstar producers engage in “preparatory exploration”; that is, they develop dependable two-way streets to experts ahead of time, setting up a relationship that will later help the star producer complete critical tasks. Moreover, the stars’ networks differed from typical workers’ networks in two important respects. First, they maintained stronger engagement with the people in their networks, so that these people responded more quickly and helpfully. As a result, the stars rarely spent time spinning their wheels or going down blind alleys.\n\nDecember 9, 2015\n\u001c42\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cStars, on the other hand, had people in their networks with a more diverse set of work roles, so they could adopt the perspectives of customers, competitors, and managers. Because they could see the situation from a variety of viewpoints, they could develop better solutions to problems.\n\nDecember 9, 2015\n\u001c42\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhen people see others adopting strategies similar to their own, they often become more confident, and they are then likely to increase their investment in that particular strategy. People’s decisions are a blend of personal information and social information, and when the personal information is weak, they will tend to rely more on social information. In a situation where people are uncertain, the confidence-enhancing effect of social learning becomes larger. 25\n\nDecember 9, 2015\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis makes perfect sense: When people don’t know what is going on, they can learn by spending more time looking at what others are doing\n\nDecember 9, 2015\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cUnfortunately, this can also lead to overconfidence and groupthink, because the mechanism of social learning only improves decision making when people have different individual information.\n\nDecember 9, 2015\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBecause idea flow takes into account the variables of a social network structure, the strength of social influence between people, and individual susceptibilities to new ideas, it also serves another vital role: It gives a reliable prediction of how changing any of these variables will change the performance of all the people in the network. Thus, this mathematically derived concept of idea flow allows us to “tune” social networks in order to make better decisions and achieve better results.\n\nDecember 9, 2015\n\u001c44\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 9, 2015\n\u001c45\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEngagement with and learning from others, along with the mutual sharing and vetting of ideas, generate the collective intelligence.\n\nDecember 9, 2015\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cnd indeed, this is why social physics works: Our behavior can be predicted from our exposure to the example behaviors of other people. In fact, humans rely so much on our ability to learn from the ideas that surround us that some psychologists refer to us as Homo imitans. 2\n\nDecember 9, 2015\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe mundane details of our daily lives have their basis in habits; in aggregate, these habits define our society. We drive on the left (or right), wake at 8:00 A.M. (or 6:00 A.M .), and eat with a fork (or chopsticks).\n\nDecember 9, 2015\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo to answer the question of how habits form, my research group studied the spread of health behaviors in a tightly knit undergraduate dorm for one year. In the Social Evolution Study, led by PhD student Anmol Madan and myself, with Professor David Lazer helping with design of the experiment and data analysis, we gave all the participating students smartphones with special software so that we could track their social interactions with both close friends and acquaintances.\n\nDecember 9, 2015\n\u001c52\n\u0011\n\u0011"},{"ty":"te","id":"i.26","spi":8439},{"ty":"te","id":"i.27","spi":9221},{"ty":"te","id":"i.28","spi":9800},{"ty":"te","id":"i.29","spi":10125},{"ty":"te","id":"i.30","spi":10630},{"ty":"te","id":"i.31","spi":10804},{"ty":"te","id":"i.32","spi":11031},{"ty":"te","id":"i.33","spi":11565},{"ty":"te","id":"i.34","spi":11601},{"ty":"te","id":"i.35","spi":11770},{"ty":"te","id":"i.36","spi":12082},{"ty":"te","id":"i.37","spi":12338},{"ty":"as","st":"paragraph","si":8430,"ei":8430,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8431,"ei":8431,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty"