false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":12341,"ei":12818,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12819,"ei":12836,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="P3z/fK0irND5Ak6++hBkmV5UaGI"  nonce="P3z/fK0irND5Ak6++hBkmV5UaGI">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="P3z/fK0irND5Ak6++hBkmV5UaGI"  nonce="P3z/fK0irND5Ak6++hBkmV5UaGI">DOCS_modelChunk = [{"ty":"is","ibi":12843,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat we found was that weight change showed a very strong association with exposure to peers who gained weight but not to those who lost weight. And further, social interaction with close friends who experienced a weight change showed no significant effect at all. A similar effect was also found when we examined eating habits, with exposure to peers being the key variable.\n\nDecember 9, 2015\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn other words, exposure to overheard comments or casual observation of other people’s behavior can drive idea flow just as well as, and in some cases better than, more direct interactions such as conversations, telephone calls, and social media. Idea flow sometimes depends more on seeing what people actually do than on hearing what they say they do\n\nDecember 9, 2015\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 9, 2015\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTherefore, people seem to pick up at least some habits from exposure to those of peers (and not just friends). When everyone else takes that second slice of pizza, we probably will also. The fact that exposure turned out to be more important for driving idea flow than all the other factors combined highlights the overarching importance of automatic social learning in shaping our lives.\n\nDecember 9, 2015\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe question we asked was: Do political views reflect the behaviors that people are exposed to or are they formed more by individual reasoning?\n\nDecember 9, 2015\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen sifting through these hundreds of gigabytes of data, we found that the amount of exposure to people possessing similar opinions accurately predicted both the students’ level of interest in the presidential race and their liberal-conservative balance.\n\nDecember 9, 2015\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMost important, though, this meant that the amount of exposure to people with similar views also predicted the students’ eventual voting behavior. For first-year students, the size of this social exposure effect was similar to the weight gain ones I described in the previous section, while for older students, who presumably had more fixed attitudes, the size of the effect was less but still quite significant. But what did not predict their voting behavior? The views of the people they talked politics with, and the views of their friends. Just as with weight gain, it was the behavior of the surrounding peer group—the set of behavior examples that they were immersed in—that was the most powerful force in driving idea flow and shaping opinion. Again, it is important to notice that it wasn’t just the number of direct interactions that mattered, but rather, it was the amount of exposure to other people’s\n\nDecember 9, 2015\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cstatements and attitudes, both direct interactions through conversations and indirect interactions through incidental observation. Overheard comments and the observation of other people’s behavior are effective drivers of idea flow\n\nDecember 9, 2015\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs Nobel Laureate Daniel Kahneman might have put it, we can consciously reason about which flow of ideas we want to swim in, but then exposure to those ideas will work to shape our habits and beliefs subconsciously.\n\nDecember 9, 2015\n\u001c56\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe app and music cases are different from the health habits or political preferences, however. In both cases we could make good predictions about what people sampled but not what they would actually use or purchase. The effect of social exposure was informational, guiding their search for new apps or new music, but not normative. In other words, the particular app or music sampled often did not turn into a habit.\n\nDecember 9, 2015\n\u001c58\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPerhaps this is because learning from surrounding example behaviors is much more efficient than learning solely from our own experiences. Mathematical models of learning in complex environments suggest that the best strategy for learning is to spend 90 percent of our efforts on exploration, i.e., finding and copying others who appear to be doing well. 15 The remaining 10 percent should be spent on individual experimentation and thinking things through. 16\n\nHow do u balance avoiding groupthink. Wbw says assume everyone else knows nothing and then reason from first principles..\n\nDecember 9, 2015\n\u001c58\n\u0011\n\u0011"},{"ty":"te","id":"i.38","s