e="text/javascript" nonce="P3z/fK0irND5Ak6++hBkmV5UaGI"  nonce="P3z/fK0irND5Ak6++hBkmV5UaGI">DOCS_modelChunk = [{"ty":"is","ibi":17128,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs the work of Stanley Milgram on social conformity demonstrated, when our peers are all doing the same thing, be it gaining or losing weight, or even doing something outrageous such as doling out electric shocks, the uniformity of the example behaviors around us strongly influences both unconscious habits and conscious decisions.\n\nDecember 9, 2015\n\u001c59\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPsychological studies have shown that the snap judgments of people are more altruistic and cooperative than the decisions made slowly and thoughtfully. 20\n\nHmm does this work for recruiting?\n\nDecember 9, 2015\n\u001c61\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMultiple exposures showing that a new behavior has a good outcome (such as social approval) are needed before we are likely to pick up the habit as our own.\n\nDecember 9, 2015\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 9, 2015\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThese data tell us that what we want and value, as well as how we choose to act in order to obtain our desires, are a constantly evolving property of interactions with other people. Our desires and preferences are mostly based on what our peer community agrees is valuable rather than on rational reflection based directly on our individual biological drives or inborn morals\n\nFor Grow, show which values are most prized in group every week. Or which competencies people are working on.\n\nDecember 9, 2015\n\u001c63\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOver time, a community with members who actively engage with each other creates a group with shared, integrated habits and beliefs. When the flow of ideas incorporates a constant stream of outside ideas as well, then the individuals in the community make better decisions than they could on their own\n\nDecember 9, 2015\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA surprising finding is that when people are working together doing the same thing in synchrony with others—e.g., rowing together, dancing together—our bodies release endorphins, natural opiates that give a pleasant high as a reward for working together. 5\n\nJanuary 8, 2016\n\u001c67\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn microfinance banks such as Grameen Bank, which are now common all over the developing world, strong social engagement is key to their success because strong engagement increases the likelihood that loans will be repaid. 8\n\nJanuary 8, 2016\n\u001c67\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe Facebook voting example suggests that information by itself is a rather weak motivator. On the other hand, both the ape troop and Bell Stars examples suggest that seeing members of our peer groups adopting a new idea provides a very strong motivation\n\nDecember 9, 2015\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut social physics tells us that there is another way: by providing incentives aimed at people’s\n\nDecember 9, 2015\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csocial networks rather than economic incentives or information packets that are aimed at changing the behavior of individual people. As we reported in the Nature journal Scientific Reports , PhD student Ankur Mani, visiting Masdar faculty member Iyad Rahwan, and I have been able work out mathematically how best to motivate people by using social network incentives to increase their cooperation. 12 These incentives alter idea flow by creating social pressure, increasing the amount of interaction around specific, targeted ideas, and thus increasing the likelihood that people will incorporate those ideas into their behavio\n\nDecember 9, 2015\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 9, 2015\n\u001c71\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfact, if anyone got three or more invitations to join the network within a half hour, and if those invitations were from people who were already engaged with\n\nDecember 9, 2015\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthem and their work group, then they were almost certain to join and give the digital social network a try. In contrast, even as many as twelve invitations within a half hour had relatively little effect if the invitations were from people who were not engaged with them or their work group.\n\nDecember 9, 2015\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 9, 2015\n\u001c76\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 18, 2015\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 19, 2015\n\u001c111\n\u0011\n\u0011"},{"ty":"te","id":"i.49","spi":17137},{"ty":"te","id":"i.50","spi":17507},{"ty":"te","id":"i.51","spi":17735},{"ty":"te","id":"i.52","spi":17929},{"ty":"te","id":"i.53","spi":17965},{"ty":"te","id":"i.54","spi":18489},{"ty":"te","id":"i.55","spi":18827},{"ty":"te","id":"i.56","spi":19120},{"ty":"te","id":"i.57","spi":19381},{"ty":"te","id":"i.58","spi":19673},{"ty":"te","id":"i.59","spi":19807},{"ty":"te","id":"i.60","spi":20472},{"ty":"te","id":"i.61","spi":20508},{"ty":"te","id":"i.62","spi":20703},{"ty":"te","id":"i.63","spi":21032},{"ty":"te","id":"i.64","spi":21068},{"ty":"te","id":"i.65","spi":21106},{"ty":"as","st":"paragraph","si":17128,"ei":17128,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{