unk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="P3z/fK0irND5Ak6++hBkmV5UaGI"  nonce="P3z/fK0irND5Ak6++hBkmV5UaGI">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="P3z/fK0irND5Ak6++hBkmV5UaGI"  nonce="P3z/fK0irND5Ak6++hBkmV5UaGI">DOCS_modelChunk = [{"ty":"is","ibi":21135,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor complex problems with many trade-offs, however, the wise guys solution may be best. Nothing beats having private information sources or successful new strategie\n\nHow would this work for spreading study abroad? Which might be too blanket a term. What if we called it overseas career training?\n\nDecember 19, 2015\n\u001c111\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe charismatic connectors are not just extroverts or life of the party types. Rather, they are genuinely interested in everyone and everything. I think their real interest is in idea flow, although probably few would describe their interest that way. They tend to drive conversations, asking about what is happening in people’s lives, how their projects are doing, how they are addressing problems, etc. The consequence is that they develop a good sense of everything that is going on and become a source of social intelligence\n\nJanuary 5, 2016\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn these sorts of time-critical social mobilization problems it is often not\n\nJanuary 5, 2016\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cpractical, or even possible, to create sufficient mobilization through mass media, due to factors such as the high cost of reaching everyone or infrastructure damage after a disaster\n\nJanuary 5, 2016\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn the Red Balloon Challenge, teams had to find ten red weather balloons deployed at undisclosed locations across the continental United States. The first team to correctly identify the locations of all ten would win a forty-thousand-dollar prize. According to DARPA, a senior analyst at the National Geospatial Intelligence Agency characterized the problem as “impossible by conventional intelligence-gathering methods.” 3\n\nJanuary 5, 2016\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 5, 2016\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe point is not just that it’s possible to get lots of people to work. Rather, the point is that it’s possible to get people to build an organization that does the work.\n\nJanuary 5, 2016\n\u001c119\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe central problem illustrated here is that these sorts of old-fashioned organizations were built using market thinking: incentivize the faceless, identical workers to produce cookie-cutter pieces of work. Because these types of organizational structures incorporate few\n\nJanuary 5, 2016\n\u001c120\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cor even no peer-to-peer network incentives, workers tend not to help each other learn best practices or maintain high levels of performance. And because workers are not engaged with management, neither has the opportunity to learn from the other, and so business processes remain rigid and inefficient. In contrast, in Wikipedia’s organization, continual exchanges between contributors and editors led to the development of interaction patterns that evolved to meet the needs of this rapidly growing enterprise. Peer pressure around these habits of interaction produced coordinated activity in a very efficient, effective manner.\n\nGrow needs to focus on a small group at first, with lots of interaction between staff and initial members. Then social incentives to recruit others and evaluate each other and teach each other.\n\nJanuary 5, 2016\n\u001c120\n\u0011\n\u0011\n\n\nPART THREE | Data-Driven Cities\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor most people, the primary pattern is the workday, that is, going to work and coming home, usually along the same path day after day. The second most pronounced pattern is the weekend and\n\nJanuary 7, 2016\n\u001c133\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdays off, often with the characteristic behavior of sleeping in and spending that night out in a location besides home or work. Perhaps surprisingly, the places we go and things we do during our free time are almost as regular as our work patterns. The third pattern, however, is a wild card: days spent exploring, usually a shopping trip or an outing. This last is distinguished by its lack of structure. Together these three patterns typically account for 90 percent or more of our behavior.\n\nJanuary 7, 2016\n\u001c133\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPerhaps the most interesting idea is to use transportation networks to increase the productivity and creative output of cities: We can use data about people’s habits to structure public transportation to promote more exploration within a city. It has long been observed that physically isolated neighborhoods have worse social outcomes. 6 This is linked to the concept developed in Chapter 2 , in which exploration among groups improves both productivity and creative output. On the scale of cities, it suggests that the number of different neighborhoods that can be visited conveniently sets the pace of exploration and thus the pace of innovation\n\nJanuary 7, 2016\n\u001c135\n\u0011\n\u0011"},{"ty":"te","id":"i.66","spi":21144},{"ty":"te","id":"i.67","spi":21479},{"ty":"te","id":"i.68","spi":22045},{"ty":"te","id":"i.69","spi":22159},{"ty":"te","id":"i.70","spi":22379},{"ty":"te","id":"i.71","spi":22840},{"ty":"te","id":"i.72","spi":22876},{"ty":"te","id":"i.73","spi":23084},{"ty":"te","id":"i.74","spi":23393}