iversity. In Chapter 2 I showed that people made much better decisions when they could see those of a wide range of other people, and their outcomes. The exception to this wisdom of the crowd phenomenon was when the social network was so dense that it formed a sort of echo chamber, so that the same ideas circulated around and around\n\nJanuary 8, 2016\n\u001c140\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo solve the problems of both insufficient diversity and echo chambers, we were able to tune the flows of ideas between people by providing small incentives, or nudges, to individuals. These caused isolated people to engage more with others, and caused people who were too interconnected to engage less and to explore outside their current contacts.\n\nJanuary 8, 2016\n\u001c140\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe pattern of links between ideas, reactions, and further suggestions provides an accurate picture of the networks along which ideas are propagated. This then facilitates the measurement of idea flow, enabling us to measure the pattern of ideas and reactions and to see whether or not a sufficiently diverse set is being considered and to determine if effective social learning\n\nGraph where the nodes are the actions and the vertices are the evaluations and reactions. (Bi-directional graph) One rating comes from expert? Or u can see that clearly.\n\nJanuary 8, 2016\n\u001c140\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cis occurring.\n\nJanuary 8, 2016\n\u001c140\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe can also create diversity ratings\n\nOf actions in regard to raising competencies?\n\nJanuary 8, 2016\n\u001c140\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn Chapter 4 , we saw that giving rewards for improvements in other peoples’ behavior produced social pressure for cooperation and that this social pressure reliably caused larger behavior changes than giving people rewards to change their own behavior.\n\nI get points when others\u0027 actions that I have rated make progress based on my suggestion / feedback What do u do with these points... Evaluations can be diverse - based on the 25 competencies plus cool, sugoi, innovative, moving, and other set words. When they log on, let them see the building graph. It will help them feel like part of an epic win. Goal: reduce idleness. Increase people collaborating. Boom. Recruiters can watch students growth in real time. Pay subscription. Like hackerrank but not just for tech. Shakaijin should be well involved so that students can see how their actions might reflect in the real world of work. Premade quests. Self made quests. Use Google maps to make it even more social and real time. Use red balloon challenge like mechanism to spread the word. Like recruit a member and if they win, u get $. It\u0027s like moocs for internships. Mentors in the cloud. Peer feedback. Incentives. Dominic and me can use to fill our free time. Content from online and books. Publicly accessible. Upvote based crowdsourcing quests for each competency. This keeps the shit relevant to real students wants.\n\nJanuary 8, 2016\n\u001c141\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis network used social incentives rather than standard economic ones: When people saved energy, gift points were given to their buddies. The social pressure this created caused electricity consumption to drop almost 17 percent—twice the improvement seen in earlier energy conservation campaigns. 13\n\nJanuary 8, 2016\n\u001c141\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA larger percentage of people now live in cities than at any other point in human history.\n\nJanuary 8, 2016\n\u001c143\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmay be that Adam Smith called it correctly: Urban centers are exceptional not only for depravity but also for innovation. 3 Despite more than a century of intense study of cities, we still lack a compelling model for why urban areas tend to promote innovation. And innovate, they do. Urban areas use resources more efficiently and produce more patents and inventions with fewer roads and services per capita than rural areas.\n\nJanuary 8, 2016\n\u001c143\n\u0011\n\u0011"},{"ty":"te","id":"i.78","spi":25733},{"ty":"te","id":"i.79","spi":26084},{"ty":"te","id":"i.80","spi":26570},{"ty":"te","id":"i.81","spi":26957},{"ty":"te","id":"i.82","spi":27544},{"ty":"te","id":"i.83","spi":27595},{"ty":"te","id":"i.84","spi":27716},{"ty":"te","id":"i.85","spi":29135},{"ty":"te","id":"i.86","spi":29473},{"ty":"te","id":"i.87","spi":29601},{"ty":"as","st":"paragraph","si":25724,"ei":25724,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":25725,"ei":25725,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":25726,"ei":25726,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":25728,"ei":25728,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":25730,"ei":25730,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":25732,"ei":25732,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell