47,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="P3z/fK0irND5Ak6++hBkmV5UaGI"  nonce="P3z/fK0irND5Ak6++hBkmV5UaGI">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="P3z/fK0irND5Ak6++hBkmV5UaGI"  nonce="P3z/fK0irND5Ak6++hBkmV5UaGI">DOCS_modelChunk = [{"ty":"is","ibi":30055,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cour closer social ties support engagement, because those people are more likely to talk to each other and provide the reinforcement that transforms ideas into behaviors. Likewise, our distant social ties serve the role of exploration, because we meet new people in new contexts and harvest new ideas from them.\n\nJanuary 8, 2016\n\u001c147\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 8, 2016\n\u001c148\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cstores, restaurants, and entertainment places that you visit most are also likely to be visited by your friends, and so are unlikely to contribute new ideas to you or your social network. The greatest chance of an experience that is new to everyone in your social network comes from the places you visit least frequently.\n\nUse YouTube. Show videos of non Japanese women doing things and this increases their exploration. Then have them talk about it.\n\nJanuary 8, 2016\n\u001c148\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cConsequently, the importance of packing people physically close to each other is still critical to promoting greater idea flow. 28 Easy face-to-face access between individuals enhances exploration, engagement, and the rate at which new ideas are converted into behaviors. Thus, physical proximity remains perhaps the major factor in productivity and creative output.\n\nGrow needs more face to face stuff.\n\nJanuary 8, 2016\n\u001c157\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 8, 2016\n\u001c158\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDigital media don’t convey social signals as well as face-to-face interactions, making it harder for people to read each other, and so digital media are less useful in generating the trust needed for behavior change. In so-called trust experiments, which set one’s potential profit by cooperating and trusting others in a group against the possibility of individually profiting from defecting from the group, we find that people who are interacting over digital media almost always defect. 29 Similarly, when we look at communication channels versus moods, we find that on days when\n\nJanuary 8, 2016\n\u001c158\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cpeople are either in a really bad mood or a really good mood, they shun e-mail, messaging, and social media, and instead turn more to face-to-face interactions and telephone calls. 30 When we need comfort or are especially happy, we want rich channels of interactions. In addition, most digital social media are sporadic, asynchronous, and sparse. As we saw in the digital engagement section of Chapter 4 , this means that it is difficult to get repeated, frequent exposure to the behavior of trusted peers. As a result, most digital social media are better at spreading facts (and rumors) than spreading new habits. Where it gets complicated is that once a social norm is in place—probably learned through face-to-face interactions—then electronic reminders can be quite effective. For instance, it is real-world interactions that drive most electronic interactions but once begun, electronic media can reinforce a trusted relationship, even though the people remain physically separated\n\nJanuary 8, 2016\n\u001c158\n\u0011\n\u0011\n\n\nPART FOUR | Data-Driven Society\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 13, 2017\n\u001c161\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPrivate organizations collect the vast majority of personal data in the form of location patterns, financial transactions, phone and Internet communications, and so on. These data must not remain the exclusive domain of private companies, because then they are less likely to contribute to the common good. Thus, these private organizations must be key players in the New Deal on Data’s framework for privacy and data control. Likewise, these data should not become the exclusive domain of the government, because this will not serve the public interest of transparency, and we should be suspicious of trusting the government with such power.\n\nJanuary 8, 2016\n\u001c162\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGoogle Dashboard (www.google .com/dashboard), which lets users know what data it has about them\n\nJanuary 8, 2016\n\u001c166\n\u0011\n\u0011\n\n\nAppendix 1 | Reality Mining\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cjust from data such as how much a subject walks around, who they call and when, and how much and when they socialize face-to-face, a user’s personality type and disposable income can be estimated. We can also see when someone is coming down with the flu or is depressed.\n\nJanuary 8, 2016\n\u001c198\n\u0011\n\u0011"},{"ty":"te","id":"i.88","spi":30064},{"ty":"te","id":"i.89","spi":30412},{"ty":"te","id":"i.90","spi":30448},{"ty":"te","id":"i.91","spi":30936},{"ty":"te","id":"i.92","spi":31377},{"ty":"te","id":"i.93","spi":31413},{"ty":"te","id":"i.94","spi":32033},{"ty":"te","id":"i.95","spi":33093},{"ty":"te","id":"i.96","spi":33127},{"ty":"te","id":"i.97","spi":33807},{"ty":"te","id":"i.98","spi":33970},{"ty":"as","st":"paragraph","si":30055,"e