is captured as hashed identifiers and never saved in clear text. Examples of standard funf sensing functions are:\n\nJanuary 8, 2016\n\u001c202\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGPS WLAN Accelerometer Bluetooth Cell tower ID Call log SMS log Browser history Contacts Running apps Installed apps Screen state Media battery status Social media activity, credit card activity, and other sorts of information can\n\nJanuary 8, 2016\n\u001c202\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001calso be recorded. It is available for Android mobile phones at http://www.funf.org.\n\nJanuary 8, 2016\n\u001c202\n\u0011\n\u0011\n\n\nAppendix 4 | Math\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe influence model is built on an explicit abstract definition of influence: An entity’s state is affected by its network neighbors’ states and changes accordingly. Each entity in the network has a specifically defined strength of influence over every other entity and, equivalently, each relationship can be weighted according to this strength.\n\nJanuary 8, 2016\n\u001c218\n\u0011\n\u0011"}
